const index = () => {
  const sendMessage = (e) => {
    e.preventDefault();
    alert('test');
  };
  return (
    <div>
      <h1>Socket io private messaging</h1>
      <form onSubmit={e => sendMessage(e)}>
        <input placeholder="Type message" />
        <button type="submit">Send message</button>
      </form>
    </div>
  )
}

export default index;
